import React, { useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import '../styles/Login.css';

function Login() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [role, setRole] = useState("doctor");
  const [showPassword, setShowPassword] = useState(false);
  const [error, setError] = useState("");
  const navigate = useNavigate();

  const handleLogin = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post("http://localhost:8070/api/login", {
        email,
        password,
        role,
      });
      if (response.data.success) {
        navigate(`/${role}-home`); // Redirect based on role
      } else {
        setError("Invalid credentials");
      }
    } catch (error) {
      setError("Error logging in");
    }
  };

  return (
    <div className="login-container">
      <h2>Welcome Back!</h2>
      <h3>Login Page</h3>
      <form onSubmit={handleLogin}>
        <div className="role-selection">
          <input
            type="radio"
            id="doctor"
            name="role"
            value="doctor"
            checked={role === "doctor"}
            onChange={() => setRole("doctor")}
          />
          <label htmlFor="doctor">Doctor</label>
          
          <input
            type="radio"
            id="clinical"
            name="role"
            value="clinical"
            checked={role === "clinical"}
            onChange={() => setRole("clinical")}
          />
          <label htmlFor="clinical">Clinical Staff</label>

          <input
            type="radio"
            id="admin"
            name="role"
            value="admin"
            checked={role === "admin"}
            onChange={() => setRole("admin")}
          />
          <label htmlFor="admin">Admin</label>
        </div>

        <input
          type="email"
          placeholder="Email or Username"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          required
        />
        <input
          type={showPassword ? "text" : "password"}
          placeholder="Password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          required
        />
        <div className="show-password">
          <input
            type="checkbox"
            checked={showPassword}
            onChange={() => setShowPassword(!showPassword)}
          />
          <label>Show Password</label>
        </div>

        <button type="submit">Login</button>
        {error && <p className="error">{error}</p>}
      </form>
      <p>
        Forgot Password? <a href="/forgot-password">Reset it</a>
      </p>
      <p>
        Donâ€™t have an account? <a href="/register">Register Now</a>
      </p>
    </div>
  );
}

export default Login;
